css:
atom-text-editor,
:host {
  background-color: #101218;
  color: #c9ccdb;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #1f222d;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #252936;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #252936;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: inherit;
  color: #d1d4e0;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #252936;
  color: #d1d4e0;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #d1d4e0;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #7780a1;
}
atom-text-editor .invisible,
:host .invisible {
  color: #c9ccdb;
}
atom-text-editor .cursor,
:host .cursor {
  color: #ffffff;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #34394b;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #7780a1;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.comment {
  color: #7780a1;
}
.entity.name.type {
  color: #c0b7f9;
}
.entity.other.inherited-class {
  color: #a5ffe1;
}
.keyword {
  color: #c0b7f9;
}
.keyword.control {
  color: #ee829f;
}
.keyword.operator {
  color: #ee829f;
}
.keyword.operator.new {
  color: #ee829f;
}
.keyword.other.special-method {
  color: #97bbf7;
}
.keyword.other.unit {
  color: #c0b7f9;
}
.storage {
  color: #a5ffe1;
}
.constant {
  color: #ee829f;
}
.constant.character.escape {
  color: #97e0ff;
}
.constant.numeric {
  color: #97e0ff;
}
.constant.other.color,
.constant.other.rgb-value {
  color: #97e0ff;
}
.constant.other.symbol {
  color: #a5ffe1;
}
.constant.boolean {
  color: #c0b7f9;
}
.constant.dom {
  color: #97e0ff;
}
.variable {
  color: #a5ffe1;
}
.variable.interpolation {
  color: #e8557d;
}
.variable.parameter.function {
  color: #c9ccdb;
}
.invalid.illegal {
  background-color: #ee829f;
  color: #101218;
}
.string {
  color: #ffefcc;
}
.string.regexp {
  color: #97e0ff;
}
.string.regexp .source.ruby.embedded {
  color: #f99170;
}
.string.other.link {
  color: #ee829f;
}
.punctuation.definition.comment {
  color: #7780a1;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #c9ccdb;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #97bbf7;
}
.punctuation.definition.bold {
  color: #fcc09e;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #c0b7f9;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #e8557d;
}
.support.class {
  color: #fcc09e;
}
.support.function {
  color: #97e0ff;
}
.support.function.any-method {
  color: #97bbf7;
}
.entity.name.function {
  color: #97e0ff;
}
.entity.name.class,
.entity.name.type.class {
  color: #fcc09e;
}
.entity.name.section {
  color: #97bbf7;
}
.entity.name.tag {
  color: #97e0ff;
}
.entity.other.attribute-name {
  color: #a5ffe1;
}
.entity.other.attribute-name.id {
  color: #97bbf7;
}
.meta.class {
  color: #fcc09e;
}
.meta.link {
  color: #f99170;
}
.meta.require {
  color: #97bbf7;
}
.meta.selector {
  color: #c0b7f9;
}
.meta.separator {
  background-color: #252936;
  color: #c9ccdb;
}
.none {
  color: #c9ccdb;
}
.markup.bold {
  color: #f99170;
  font-weight: bold;
}
.markup.changed {
  color: #c0b7f9;
}
.markup.deleted {
  color: #ee829f;
}
.markup.italic {
  color: #c0b7f9;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #97bbf7;
}
.markup.inserted {
  color: #a5ffe1;
}
.markup.list {
  color: #ee829f;
}
.markup.quote {
  color: #f99170;
}
.markup.raw.inline {
  color: #a5ffe1;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #a5ffe1;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
.scss.keyword,
.css.keyword,
.scss.support.function,
.css.support.function {
  color: #ee829f;
}
.scss.support.property-name,
.css.support.property-name {
  color: #a5ffe1;
}
.scss.support.constant,
.css.support.constant,
.scss.punctuation.constant,
.css.punctuation.constant {
  color: #c0b7f9;
}
.scss.entity.other.attribute-name,
.css.entity.other.attribute-name {
  color: #97e0ff;
}
.scss.variable,
.css.variable {
  color: #c0b7f9;
}
.less.variable {
  color: #c0b7f9;
}
